  false,\n\t\"url\": null,\n\t\"notes\": \"This data set represents the results of
  analyses conducted by the Department of Defense to assess the compatibility of offshore
  wind development with military assets and activities. The assessments were developed
  for the renewable energy task force process being led by the Bureau of Ocean Energy
  Management (BOEM). The task force process is being carried out as part of the offshore
  renewable energy rule that stems from authority granted to BOEM for leasing Outer
  Continental Shelf (OCS) lands for energy development and allows government agencies
  with an interest in activities on the OCS to provide information describing their
  existing activities. These data should not be used to infer compatibility or conflict
  between military assets or activities with any use other than offshore wind. The
  data set contains 4 categories of OCS lease blocks: No Restrictions - No significant
  conflicts with offshore wind development were identified. Site Specific Stipulations
  - Potential conflicts exist and may require site specific measures be developed
  to avoid or limit impacts to military assets or activities. Recommended Wind Exclusion
  - Significant conflicts exist between offshore wind and military assets or activities.
  Not Assessed - Areas without a red, yellow, or green color fill have not been assessed
  for compatibility with offshore wind.\",\n\t\"license_title\": null,\n\t\"extras\":
